// This function changes the occurrences library into a probability library. 
function normalizeLibrary(input) {
	// Create the new library. 
	var normalizedLib = new Array(input.length); 
	for (var ii = 0; ii < input.length; ii++) {
		normalizedLib[ii] = new Array(input[0].length); 
	}
	// For each input note, change the outputs to probabilities. 
	for (var x = 0; x < 128; x++) {
		// Find the sum, which is the denominator in probabilities. 
		var sum = 0; 
		for (var y = 0; y < 128; y++) {
			if (input[x][y] != undefined) sum += input[x][y]; 
		}
		// Now adjust and store. 
		for (var y = 0; y < 128; y++) {
			normalizedLib[x][y] = input[x][y] / sum; 
		}
	}
	// Return. 
	return normalizedLib; 
}

