// This function returns an array of length numOfPredictions containing predictions. 
function getPredictions(inputNote, pLibrary, numOfPredictions) {
	var pArray = pLibrary[inputNote]; 
	
	// Create a "target board" array to throw imaginary darts at. 
	var targetArray = []; 
	targetArray.push(0.0); 
	var tI = 1; 
	for (var i = 0; i < pArray.length; i++) {
		if (pArray[i] != undefined) {
			if ((targetArray[tI - 1] + parseFloat(pArray[i])) > 1) break; 
			targetArray.push(targetArray[tI - 1] + parseFloat(pArray[i])); 
			tI++; 
		}
	}
	
	// Now shoot a dart at the target array and see where it landed for numOfPredictions times. 
	var indexOfPredictions = 0; 
	var predictionsResults = []; 
	
	this.getProbResult = function () {
		var dart = Math.random(); 
		for (var i = 1; i < targetArray.length; i++) {
			if (targetArray[i - 1] <= dart && dart <= targetArray[i]) return (i - 1); 
		}
	}
	
	predictionsResults.push(this.getProbResult()); 
	indexOfPredictions ++; 
	var attempts = 0; 
	
	while (indexOfPredictions < numOfPredictions) {
		var tmp = this.getProbResult(); 
		if (!predictionsResults.includes(tmp)) {
			predictionsResults.push(tmp); 
			indexOfPredictions ++; 
		}
		attempts++; 
		// Don't waste all the time guessing. 
		if (attempts > 500) break; 
	}
	
	return predictionsResults; 
}

// This function ranks the highest to lowest probabilities instead of throwing darts. 
function getPredictionsD(inputNote, pLibrary, numOfPredictions) {
	var pArray = pLibrary[inputNote]; 
	return getHighestIndices(pArray, numOfPredictions); 
}

// This function retunrs the highest count numbers' indices in arrInput. 
function getHighestIndices(arrInput, count) {
	// Approach: get highest, mark index, then get second highest, etc. 
	var resArray = []; 
	var currentCount = 0; 
	var cloneArray = arrInput.slice(0); 
	
	while (currentCount < count) {
		// Find highest not including the previous highest. 
		// First, remove the highest. 
		if (currentCount != 0) {
			var removeIndex = cloneArray.indexOf(Math.max(...cloneArray)); 
			cloneArray[removeIndex] = cloneArray[cloneArray.indexOf(Math.min(...cloneArray))]; 
		}
		resArray.push(cloneArray.indexOf(Math.max(...cloneArray))); 
		currentCount++; 
	}
	
	return resArray; 
}